import React from "react";
import Nav from "./components/Nav";
import Router from "./components/Router";
import Footer from "./components/Footer";
import "./App.scss";

function App() {
  return (
    <>
      <Nav />
      <Router />
      <Footer />
    </>
  );
}
export default App;
